import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Navbar from './client/Navbar/components/Navbar';
import Phonebook from './client/ContactsPage/pages/Phonebook';

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Switch>
        <Route>
          <Phonebook />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
